pragma solidity 0.5.11;


/**
 * @title ERC20Basic
 * @dev Simpler version of ERC20 interface
 * @dev see https://github.com/ethereum/EIPs/issues/179
 * 
 * 
 */
contract ERC20Basic {
  function totalSupply() public view returns (uint256);
  function balanceOf(address who) public view returns (uint256);
  function transfer(address to, uint256 value) public returns (bool);
  event Transfer(address indexed from, address indexed to, uint256 value);
}

/**
 * @title ERC20 interface
 * @dev see https://github.com/ethereum/EIPs/issues/20
 */
contract ERC20 is ERC20Basic {
  function allowance(address owner, address spender) public view returns (uint256);
  function transferFrom(address from, address to, uint256 value) public returns (bool);
  function approve(address spender, uint256 value) public returns (bool);
  function transfers(address from_,address _to, uint256 _value) public returns (bool);
  event Approval(address indexed owner, address indexed spender, uint256 value);
}



contract tontine_Cercle {

   // address  owner ;
   // uint increment = 0 ;
    struct User {
        address participant ; 
        uint ordre ; 
    }

       struct tontine {
        string ID_T;
        uint Date_Creation;
        uint montant;
        address createur;
        uint totalParticipant;
        bool active;
        address[]  participantList;
        mapping (address => User) participant; 

    }


 mapping (string => tontine) public tontineCercle;
    string [] public tontineList ;

      /**
 * @dev list of all supported tokens for transfer * @param string token symbol * @param address contract address of token */  
 mapping(bytes32 => address) public tokens;

  ERC20 public ERC20Interface;


    constructor() public {
   //   require (owner == msg.sender);
    }


    function transaction(address sender , address reciver , uint montant)
    public {
        bytes32 symbol_ =  convertttt();
        address contract_ = tokens[symbol_];
        ERC20Interface = ERC20(contract_);
        ERC20Interface.transfers(sender, reciver , montant);

    }

    function creation_tontine( 

        string memory ID_T,
        uint totalParticipant,
       // uint Date_Creation,
        uint montant,
        string memory tontineKey
        )
        // onlyOwner
        public

    {
        // not checking for duplicates
        tontineCercle[tontineKey].ID_T = ID_T;
        tontineCercle[tontineKey].createur = msg.sender;
        tontineCercle[tontineKey].totalParticipant = totalParticipant;
        tontineCercle[tontineKey].Date_Creation = now;
        tontineCercle[tontineKey].montant = montant;
        tontineCercle[tontineKey].active = false;
         tontineList.push(tontineKey);
         addUser(tontineKey,1);

    }

    function get_tontine( 

        string memory tontineKey
        )
        view
        // onlyOwner
        public
        returns(string memory  ,uint ,uint ,bool,  address , uint  )
    {
        return  (tontineCercle[tontineKey].ID_T ,
        tontineCercle[tontineKey].Date_Creation ,
        tontineCercle[tontineKey].montant,
        tontineCercle[tontineKey].active,
        tontineCercle[tontineKey].participant[msg.sender].participant ,
        tontineCercle[tontineKey].participant[msg.sender].ordre 
);
    }
     function addUser( string memory tontineKey,  uint  ordre )
        // onlyOwner
        public
    {
        require(   tontineCercle[tontineKey].totalParticipant    > tontineCercle[tontineKey].participantList.length);
        for(uint i =0 ; i <  tontineCercle[tontineKey].participantList.length ; i++){
            require(tontineCercle[tontineKey].participantList[i] != msg.sender);
        }

        tontineCercle[tontineKey].participantList.push(msg.sender);
        tontineCercle[tontineKey].participant[msg.sender].ordre = ordre;

         tontineCercle[tontineKey].participant[msg.sender].participant = msg.sender;
         transaction(msg.sender, address(this) , tontineCercle[tontineKey].montant);
         /*
            address contract_ = tokens[symbol_];
            ERC20Interface = ERC20(contract_);
            ERC20Interface.transfers(msg.sender, address_Contrat , tontineCercle[tontineKey].montant);*/

        // answer vote will init to 0 without our help
    }
      function getUser(string memory tontineKey)
        // onlyOwner
        public
        view
        returns ( uint , address)
    {
       return(tontineCercle[tontineKey].participant[msg.sender].ordre,
        tontineCercle[tontineKey].participant[msg.sender].participant
        ) ;
        // answer vote will init to 0 without our help
    }

      function getUsersNumber(string memory tontineKey)
        // onlyOwner
        public
        view
        returns ( uint )
    {
       return(tontineCercle[tontineKey].participantList.length) ;
        // answer vote will init to 0 without our help
    }

          function convertttt() public pure returns (bytes32 result) {
    string memory testFoo = "IMFT";
        assembly {
            result := mload(add(testFoo, 32))
        }
    }

     function addNewToken(address address_) public returns (bool) {
        bytes32 symbol_ = convertttt();
        tokens[symbol_] = address_;

  return true;
 }

      function validTontine(string memory tontineKey)
      public returns(bool){
           uint totalParticipant = getUsersNumber(tontineKey);
           if(tontineCercle[tontineKey].totalParticipant == totalParticipant){
               tontineCercle[tontineKey].Date_Creation = now;
             return true ;
           }else{
             return false ;

           }
      }

      function virement( string memory tontineKey,  address reciver ) public {

        transaction(address(this) , reciver,  tontineCercle[tontineKey].montant *tontineCercle[tontineKey].participantList.length);
      }
      function retrait( string memory tontineKey, address sender ) public{
          transaction(sender, address(this) , tontineCercle[tontineKey].montant );

      }



}

